import React from "react";

const Card = (props) => {
  console.log("Hello", props);
  const { banner, animate, name, when, award, title } = props.data;
  return (
    <div className="text-center bg-gray" data-aos={animate}>
      <img src={banner} alt="image" className="card-pic" />

      <div className="card-body text-dark">
        <h3 className="card-title">
          {name}
          <br />
          <span className="fs-1-5vw">{title}</span>
        </h3>
        <p className="card-text text-secondary">{when}</p>
        {award != null && <h5 className="card-text text-secondary">{award}</h5>}
      </div>
    </div>
  );
};

export default Card;
